import React, { useState } from "react";
import { useParams } from "react-router-dom";
import axios from "axios";

const AddCourses = () => {
  const { specializationId } = useParams(); // Access specialization ID from URL
  const [formData, setFormData] = useState({
    course_id: "",
    course_code: "",
    name: "",
    description: "",
    year: "",
    term: "",
    faculty: "",
    credits: "",
    capacity: "",
  });
  const [message, setMessage] = useState("");

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const token = localStorage.getItem("token");
      const response = await axios.post(
        "http://localhost:8080/api/v1/specialization/Courses",
        { ...formData, specializationId }, // Pass specialization ID with form data
        { headers: { Authorization: `Bearer ${token}` } }
      );
      setMessage(response.data);
    } catch (error) {
      setMessage("Error adding course.");
    }
  };

  return (
    <div className="container mt-5">
      <h2 className="text-center">Add Course to Specialization</h2>
      {message && <div className="alert alert-info">{message}</div>}
      <form onSubmit={handleSubmit}>
        <div className="mb-3">
          <label htmlFor="course_id" className="form-label">Course ID</label>
          <input type="text" className="form-control" id="course_id" name="course_id" onChange={handleChange} required />
        </div>
        <div className="mb-3">
          <label htmlFor="course_code" className="form-label">Course Code</label>
          <input type="text" className="form-control" id="course_code" name="course_code" onChange={handleChange} required />
        </div>
        <div className="mb-3">
          <label htmlFor="name" className="form-label">Name</label>
          <input type="text" className="form-control" id="name" name="name" onChange={handleChange} required />
        </div>
        <div className="mb-3">
          <label htmlFor="description" className="form-label">Description</label>
          <textarea className="form-control" id="description" name="description" onChange={handleChange} required></textarea>
        </div>
        <div className="mb-3">
          <label htmlFor="year" className="form-label">Year</label>
          <input type="text" className="form-control" id="year" name="year" onChange={handleChange} required />
        </div>
        <div className="mb-3">
          <label htmlFor="term" className="form-label">Term</label>
          <input type="text" className="form-control" id="term" name="term" onChange={handleChange} required />
        </div>
        <div className="mb-3">
          <label htmlFor="faculty" className="form-label">Faculty</label>
          <input type="text" className="form-control" id="faculty" name="faculty" onChange={handleChange} required />
        </div>
        <div className="mb-3">
          <label htmlFor="credits" className="form-label">Credits</label>
          <input type="number" className="form-control" id="credits" name="credits" onChange={handleChange} required />
        </div>
        <div className="mb-3">
          <label htmlFor="capacity" className="form-label">Capacity</label>
          <input type="number" className="form-control" id="capacity" name="capacity" onChange={handleChange} required />
        </div>
        <button type="submit" className="btn btn-success w-100">Add Course</button>
      </form>
    </div>
  );
};

export default AddCourses;
